import { combineReducers } from "redux";
import authReducer from "./authReducer";
import tweetReducer from "./tweetReducer";
import userProfileReducer from "./userProfileReducer";

export default combineReducers({
  authReducer,
  tweetReducer,
  userProfileReducer
});
